import './App.css';
import { useState } from 'react';
import data from './data';

function App() {
  const [allNames, setAllNames] = useState([])
  const [bornBefore1990, setBornBefore1990] = useState([])


  setAllNames((data) => data.map((person) => person.name));
  setBornBefore1990((data) => data.map((person) => person.birthday.split('-')[2] < 1990));

  return (
    <div className='./App.css'>
      {allNames}
      {bornBefore1990}
    </div>

  );
}

export default App;
